import React, { useState, useEffect } from 'react';

function BusinessInsights() {
  const [restaurantData, setRestaurantData] = useState([]);
  const [searchPhone, setSearchPhone] = useState('');

  useEffect(() => {
    fetch('/api/restaurantData')
      .then(response => response.json())
      .then(data => setRestaurantData(data))
      .catch(error => console.error('Error fetching restaurant data', error));
  }, []);

  // Filter restaurants based on the entered phone number
  const filteredRestaurants = restaurantData.filter(restaurant =>
    restaurant.phoneNumber.includes(searchPhone)
  );

  // Function to determine the style based on cuisine type
  const getCuisineStyle = cuisineType => {
    let backgroundColor;
    switch (cuisineType) {
      case 'Italian':
        backgroundColor = 'lightgreen';
        break;
      case 'Indian':
        backgroundColor = 'lightcoral';
        break;
      case 'Mexican':
        backgroundColor = 'lightyellow';
        break;
      default:
        backgroundColor = 'transparent';
    }
    return {
      backgroundColor,
      padding: '5px',
      borderRadius: '5px'
    };
  };

  return (
    <div className="flex justify-center items-center h-screen">
      <div className="text-center">
        <h2 className="text-2xl font-bold mb-4">All businesses</h2>
        <h1 className="text-gray-400">Monitor sales and status</h1>

        <div className="mb-4 flex justify-center">
          <div className="relative">
            <input
              type="text"
              placeholder="Search by Phone"
              value={searchPhone}
              onChange={e => setSearchPhone(e.target.value)}
              className="border rounded px-3 py-2 pl-10" // Increased left padding to accommodate the icon
            />
            <div className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-500">
              <svg
                xmlns="http://www.w3.org/2000/svg"
                viewBox="0 0 24 24"
                width="20" // Reduced icon size for better alignment
                height="20" // Reduced icon size for better alignment
                fill="none"
                stroke="currentColor"
                strokeWidth="2"
                strokeLinecap="round"
                strokeLinejoin="round"
                className="feather feather-search"
              >
                <circle cx="11" cy="11" r="8" />
                <line x1="21" y1="21" x2="16.65" y2="16.65" />
              </svg>
            </div>
          </div>
        </div>
        
        <table className="border-collapse mx-auto rounded-lg overflow-hidden">
          <thead>
            <tr>
              <th className="border px-4 py-2 bg-gray-200 text-black font-normal">Restaurant Name</th>
              <th className="border px-4 py-2 bg-gray-200 text-black font-normal">Cuisine Type</th>
              <th className="border px-4 py-2 bg-gray-200 text-black font-normal">Phone Number</th>
              <th className="border px-4 py-2 bg-gray-200 text-black font-normal">Longitude</th>
              <th className="border px-4 py-2 bg-gray-200 text-black font-normal">Latitude</th>
              <th className="border px-4 py-2 bg-gray-200 text-black font-normal">Delivery Distance</th>
            </tr>
          </thead>
          <tbody>
            {filteredRestaurants.map(restaurant => (
              <tr key={restaurant.id}>
                <td className="border px-4 py-2 text-black">{restaurant.restaurantName}</td>
                <td className="border px-4 py-2 text-black">
                  <span style={getCuisineStyle(restaurant.cuisineType)}>{restaurant.cuisineType}</span>
                </td>
                <td className="border px-4 py-2 text-black">{restaurant.phoneNumber}</td>
                <td className="border px-4 py-2 text-black">{restaurant.longitude}</td>
                <td className="border px-4 py-2 text-black">{restaurant.latitude}</td>
                <td className="border px-4 py-2 text-black">{restaurant.deliveryDistance}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default BusinessInsights;
